import React from "react";
import "../src/styles/Barcode.css";
import Img11 from "./assets/바코드1.png";
import Img22 from "./assets/바코드2.png";
import Img33 from "./assets/바코드3.png";
import Img44 from "./assets/바코드4.png";
import Img55 from "./assets/바코드5.png";
import Img66 from "./assets/바코드6.png";
import ShareButton from "./assets/공유하기버튼.png";

const Barcode = () => {
  const handleShare = () => {
    alert("성공적으로 공유되었습니다!");
  };

  return (
    <div className="barcode-container">
      <p className="info-text">
        구매한 상품은 내 정보 → 구매내역 에서도 확인 가능합니다
      </p>
      <div className="product-info">
        <button className="share-button" onClick={handleShare}>
          <img src={ShareButton}></img>
        </button>
        <img src={Img11} alt="황금손지압기" className="product-image" />
      </div>
      <div className="product-info">
        <button className="share-button" onClick={handleShare}></button>
        <img src={Img22} alt="황금손지압기" className="product-image" />
      </div>
      <div className="product-info">
        <button className="share-button" onClick={handleShare}>
          공유하기
        </button>
        <img src={Img33} alt="황금손지압기" className="product-image" />
      </div>
      <div className="product-info">
        <button className="share-button" onClick={handleShare}>
          공유하기
        </button>
        <img src={Img44} alt="황금손지압기" className="product-image" />
      </div>
      <div className="product-info">
        <button className="share-button" onClick={handleShare}>
          공유하기
        </button>
        <img src={Img55} alt="황금손지압기" className="product-image" />
      </div>
      <div className="product-info">
        <button className="share-button" onClick={handleShare}>
          공유하기
        </button>
        <img src={Img66} alt="황금손지압기" className="product-image" />
      </div>
    </div>
  );
};

export default Barcode;
